          <a class="rightDivItem" href="#">
            Sipariş Takip
          </a>
          <a class="rightDivItem" href="#">
            Giriş Yap
          </a>
          <a class="rightDivItem" href="#">
            Sepet
            <text class="spanSepet">0</text>
          </a>
        </div>
      </div>
    );
  }
}
